        $(function() {
            var progressbar = $("#progressbar");
            var progressValue = $(".progress-value");
            var progressLabel = $(".progress-label");
            progressbar.progressbar({
                value: false,
                change: function () {
                    progressValue.text(progressbar.progressbar("value") + "%");
                },
                complete: function () {
                    progressValue.text(progressbar.progressbar("value") + "%");
                }
            });
            
            function progress() {
                var val = getInstallProcess();
                progressbar.progressbar("value", val);
            
                var processLabelText = getInstallProcessLabel();
                progressLabel.text(processLabelText);
                
                setTimeout(progress, 400);
            }
            
            setTimeout(progress, 400);
        });
        
        install();
    </script>
