        alert("dragWindow");
    },
    
    installInfo: {
        count : 0,
        percent: 0,
        label : "0%"
    },
    
    mokeInstall: function() {
        external.installInfo.count = external.installInfo.count + 1;
        if(external.installInfo.count == 10) {
            external.setProperty("installStatus", "completed");
        }
        else {
            external.setProperty("installStatus", "downloading"); 
        }
        external.installInfo.percent = external.installInfo.count * 10;
        external.installInfo.label = external.installInfo.percent + "%";
        setTimeout(external.mokeInstall, 1000);
    },
    
    install: function(url, exeParams) {
        this.mokeInstall();
    },

    getInstallProcess: function () {
        return this.installInfo.percent;
    },

    getInstallProcessLabel: function() {
        return this.installInfo.label;
    },
    
    startInstallProgram: function(startPrograms) {
        alert("startInstallPrograms");
    },
    
    openPage: function(url) {
        alert("goto " + url);
    }
};

